// src/components/Battle.jsx

import React from 'react';

const Battle = ({ pokemon1, pokemon2, battleResult }) => {
  return (
    <div>
      <h2>Battle: {pokemon1.name} vs {pokemon2.name}</h2>
      <div>
        <p><strong>{pokemon1.name}:</strong> HP: {pokemon1.stats[0].base_stat}</p>
        <p><strong>{pokemon2.name}:</strong> HP: {pokemon2.stats[0].base_stat}</p>
      </div>
      <h3>Winner: {battleResult}</h3>
    </div>
  );
};

export default Battle;
